- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    employs a full time Executive Director, whose time is more than 25 percent devoted
    to federal elections and candidates.  No other entity pays compensation for their
    employees to work for the committee. The Fairfax County Democratic Committee maintains
    both Federal and Non Federal accounts, and beginning with this report, it transfers
    qualified joint administrative expenses between accounts on a 36 percent Federal,
    64 percent Non Federal split, due to federal elections in Virginia this year for
    both President and Senate. The transfer of June and July 2008 allocated expenses
    occurs in this report of expenditures for August 2008. The Committee does not
    engage in any fundraising on behalf of candidates for Federal office, so all of
    its reported fundraising expenses are party fundraising.The main purpose of this
    amendment is to align the corrected cumulative balance with the previously amended
    monthly reports for 2008. In addition, certain labels on disbursements have been
    restated to clarify purposes of the expenses or to correct errors in original
